  true,\n\t\"url\": null,\n\t\"notes\": \"<p>TABLE III. Deaths in 122 U.S. cities
  u00e2u0080u0093 2016.  122 Cities Mortality Reporting System u00e2u0080u0094 Each
  week, the vital statistics offices of 122 cities across the United States report
  the total number of death certificates processed and the number of those for which
  pneumonia or influenza was listed as the underlying or contributing cause of death
  by age group (Under 28 days, 28 days u00e2u0080u00931 year, 1-14 years, 15-24 years,
  25-44 years, 45-64 years, 65-74 years, 75-84 years, and u00e2u0089u00a5 85 years).</p>n<p>FOOTNOTE:<br
  />nU: Unavailable. u00e2u0080u0094: No reported cases.<br />n* Mortality data in
  this table are voluntarily reported from 122 cities in the United States, most of
  which have populations of 100,000 or more. A death is reported by the place of its
  occurrence and by the week that the death certificate was filed. Fetal deaths are
  not included.</p>n<p>u00e2u0080u00a0 Pneumonia and influenza.</p>n<p>u00c2u00a7
  Total includes unknown ages.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
